struct main{struct Point (*Point)(float,float,void *);struct Point (*a)(void *);void (*printString)(void *,char *);};struct Point{float  y ;void *main;float x ;float (*length)(void *);float (*squared)(void *);float (*xSquared)(void *);float (*ySquared)(void *);};float main_Point_xSquared_(void *Point){return powf(x,2);}float main_Point_ySquared_(void *Point){return powf(y,2);}float main_Point_squared_(void *Point){return xSquared(&squared)=ySquared(&squared);}float main_Point_length_(void *Point){return sqrtf(squared(&length));}struct Point main_Point_(float  y ,float x ,void *main){struct Point Point={ y ,main,x ,NULL,NULL,NULL,NULL};float (*xSquared)(void *)=main_Point_xSquared_;Point.xSquared=xSquared;float (*ySquared)(void *)=main_Point_ySquared_;Point.ySquared=ySquared;float (*squared)(void *)=main_Point_squared_;Point.squared=squared;float (*length)(void *)=main_Point_length_;Point.length=length;return Point;}struct Point main_a_(void *main){return Point(main,3,4);}void main_printString_(void *main,char *message ){printf("%s",message);}int main(){struct main main={NULL,NULL,NULL};struct Point (*Point)(float,float,void *)=main_Point_;struct Point (*a)(void *)=main_a_;main.a=a;void (*printString)(void *,char *)=main_printString_;main.printString=printString;printString(&main,"Hello World!");return 0;}